    async Task Delete(int id)
    {
        bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
        if (confirmed)
        {
                bool isSave = false;
                isSave = _product.Delete(id);
                if (isSave == true)
