    {
        PdfProduct pdfExp = new PdfProduct();
        JsRuntime.InvokeAsync<ProductView>(
            "saveAsFile",
            "Product.pdf",
            Convert.ToBase64String(pdfExp.Report(listModel))
        );
    }

